import React from "react";
import { NavLink } from "react-router-dom";
export default function Navpar() {
  return (
    <div>
      <ul>
        <li>
          {" "}
          <NavLink end to={"/"}>
            Home
          </NavLink>
        </li>
        <li>
          <NavLink to={"/about"}>About</NavLink>
        </li>
        <li>
          <NavLink to={"/tail"}>TailWind</NavLink>
        </li>
      </ul>
    </div>
  );
}
